// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

interface ISyndicateClosedEndFundDepositLogicV0 {
    function managerSetDepositMemberMin(
        address syndicateAddress,
        uint256 depositMemberMin
    ) external;

    function managerSetDepositMemberMax(
        address syndicateAddress,
        uint256 depositMemberMax
    ) external;

    function managerSetDepositTotalMax(
        address syndicateAddress,
        uint256 depositTotalMax
    ) external;

    function memberDeposit(address syndicateAddress, uint256 amount) external;

    function memberWithdraw(address syndicateAddress, uint256 amount) external;

    function managerRejectDepositForMembers(
        address syndicateAddress,
        address[] calldata memberAddresses
    ) external;

    function managerSetDepositForMembers(
        address syndicateAddress,
        address[] calldata memberAddresses,
        uint256[] calldata amounts
    ) external;
}
